import React from 'react';
import "./Contact.css";

const Contact = () => {
    return (
        <div className='section-container'>
            < Header
                heading="My Projects"
                details="Here is a few cool things, I've worked on, do check them out!" />
            <FooterLink
                phrase="check out " link="my skills!" toAdress="/skills" />
        </div>
    )
}

export default Contact;
